import React from "react";
import { StyleSheet,
  Text, 
  StatusBar,
  Button,
  TouchableWithoutFeedback, 
  Alert, 
  View, 
  SafeAreaView, 
  Image, 
  Platform,
  Dimensions,
} from 'react-native';

export default function Signin() {
  
  return (
    <View style={{
      backgroundColor:"red",
      flex:1,
      flexDirection:"row",
      justifyContent:"center",
      alignItems: "center",
      paddingTop: Platform.OS === "android" ? 30:0,
      flexWrap:"wrap",
    }}>
      <View style={{
      backgroundColor:"blue",
      width:100,
      height:100,
       }}/>
    <View style={{
      backgroundColor:"yellow",
      width:100,
      height:100,
    }}/>
    <View style={{
      backgroundColor:"tomato",
      width:100,
      height:100,
      }}/>
      <View style={{
      backgroundColor:"grey",
      width:100,
      height:100,
      }}/>
      <View style={{
      backgroundColor:"green",
      width:100,
      height:100,
      }}/>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#2f2f32',
    // alignItems: 'center',
    // justifyContent: 'center',
    // paddingTop: Platform.OS === "android" ? 30:0,
  },
});
